import React, { useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Button,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Box
} from '@mui/material';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { LocalizationProvider, DatePicker } from '@mui/x-date-pickers';

const SWIMMING_EVENTS = [
  '50 FR SCY', '100 FR SCY', '200 FR SCY', '500 FR SCY',
  '50 BK SCY', '100 BK SCY',
  '50 BR SCY', '100 BR SCY',
  '50 FL SCY', '100 FL SCY',
  '100 IM SCY', '200 IM SCY',
  '200 FR-R SCY', '200 MED-R SCY',
  '50 FR LCM', '100 FR LCM', '200 FR LCM', '400 FR LCM',
  '50 BK LCM', '100 BK LCM',
  '50 BR LCM', '100 BR LCM',
  '50 FL LCM', '100 FL LCM',
  '200 IM LCM',
  '200 FR-R LCM', '200 MED-R LCM'
];

const AddPerformanceModal = ({ open, onClose, onSubmit }) => {
  const [formData, setFormData] = useState({
    event: '',
    minutes: '',
    seconds: '',
    milliseconds: '',
    date: new Date(),
    competition: '',
    place: '',
    splits: []
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleDateChange = (newDate) => {
    setFormData(prev => ({
      ...prev,
      date: newDate
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const timeInSeconds = 
      (parseInt(formData.minutes || '0') * 60) +
      parseInt(formData.seconds || '0') +
      (parseInt(formData.milliseconds || '0') / 100);

    onSubmit({
      ...formData,
      time: timeInSeconds.toFixed(2)
    });

    setFormData({
      event: '',
      minutes: '',
      seconds: '',
      milliseconds: '',
      date: new Date(),
      competition: '',
      place: '',
      splits: []
    });
  };

  const validateTimeFormat = () => {
    const mins = parseInt(formData.minutes || '0');
    const secs = parseInt(formData.seconds || '0');
    const ms = parseInt(formData.milliseconds || '0');

    return (
      (mins >= 0 && mins < 60) &&
      (secs >= 0 && secs < 60) &&
      (ms >= 0 && ms < 100)
    );
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="sm" fullWidth>
      <DialogTitle>Add New Performance</DialogTitle>
      <form onSubmit={handleSubmit}>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
            <FormControl fullWidth required>
              <InputLabel>Event</InputLabel>
              <Select
                name="event"
                value={formData.event}
                onChange={handleChange}
                label="Event"
              >
                {SWIMMING_EVENTS.map((event) => (
                  <MenuItem key={event} value={event}>
                    {event}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>

            <Box sx={{ display: 'flex', gap: 1 }}>
              <TextField
                name="minutes"
                label="Minutes"
                type="number"
                value={formData.minutes}
                onChange={handleChange}
                inputProps={{ min: 0, max: 59 }}
                sx={{ width: '30%' }}
              />
              <TextField
                name="seconds"
                label="Seconds"
                type="number"
                required
                value={formData.seconds}
                onChange={handleChange}
                inputProps={{ min: 0, max: 59 }}
                sx={{ width: '30%' }}
              />
              <TextField
                name="milliseconds"
                label="Milliseconds"
                type="number"
                required
                value={formData.milliseconds}
                onChange={handleChange}
                inputProps={{ min: 0, max: 99 }}
                sx={{ width: '30%' }}
              />
            </Box>

            <LocalizationProvider dateAdapter={AdapterDateFns}>
              <DatePicker
                label="Date"
                value={formData.date}
                onChange={handleDateChange}
                renderInput={(params) => <TextField {...params} />}
              />
            </LocalizationProvider>

            <TextField
              name="competition"
              label="Competition Name"
              value={formData.competition}
              onChange={handleChange}
              required
            />

            <TextField
              name="place"
              label="Place"
              type="number"
              value={formData.place}
              onChange={handleChange}
              inputProps={{ min: 1 }}
              required
            />
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={onClose}>Cancel</Button>
          <Button 
            type="submit" 
            variant="contained" 
            color="primary"
            disabled={!validateTimeFormat()}
          >
            Add Performance
          </Button>
        </DialogActions>
      </form>
    </Dialog>
  );
};

export default AddPerformanceModal;
